import React, { PureComponent } from 'react';
import './App.css';
import Home from './components/Home';
import Waypoint from 'react-waypoint';
import { CSSTransition } from 'react-transition-group';
class App extends PureComponent {
  constructor(props){
    super(props);
    this.state={
      isActive: false
    }
  }


  handleHomeSelect(key){
    this.setState({key});
  }

  _showBio(){
    this.setState({isActive: true});
  }

  render() {

    const {
      isActive
    } = this.state;

    return (
      <Waypoint
      onEnter={this._LoadPage.bind(this)}
  >
      <CSSTransition
          in={isActive}
          timeout={300}
          classNames="pages"
          unmountOnExit
      >
      <div className="App">

        <Home />

      </div>

      </CSSTransition>
        </Waypoint>
    );
  }
}

export default App;
